import styled from "styled-components";
export const ContentBlock = styled.div`
  width: 100%;
  height: 85vh;
  display: flex;
  position: relative;
`;

export const ContentPage = styled.section`
  width: 90%;
  height: 85vh;
  background-color:#eee;
`;

export const ContentItem = styled.article`
  height: 100%;
  background-color:fuchsia;
  border-radius: 15px;
  overflow: auto;
`;

export const ContentItemHeader = styled.div`
  width: 95%;
  margin: 3% auto;
  margin-top: 3%;
  background-color: #00B7FF;
  height: 10%;
`;

export const ContentItemBody = styled.div`

`;
